import { getdata } from "../API/Api";

export const getdataAction = () => {

  return (dispatch,getState)=>{
   
     getdata(dispatch)
  }
 
};


export const fetchdata = (data)=>{
  if (data) {
    return {
      type: "fetchdata",
      payload: data
    };
  }
  
}
